var twoSum = function(numbers, target) { 
  var index1,index2 ,result=[];
     for(var m=0;m<numbers.length;m++){
        for(var n=m+1;n<numbers.length;n++)
           if((numbers[m]+numbers[n])===target){
             index1=m+1;
             index2=n+1;
             
             result.push(index1,index2);
         
           }

     }
     return  result;
    
};
